const Home = () => {
	return (
		<div className="absolute flex flex-col items-center justify-center left-0 top-0 right-0 bottom-0">
		<div className="w-96 h-3/5 z-100 bg-white rounded-md shadow-lg ">
		  <Header />
		  <div className="h-96 justify-center p-10">
			<img src='aircallgif' />
		  </div>
		  <div className='w-full flex justify-center'>
		  <button className={'bg-app-green text-white px-6 py-2 rounded-lg hover:shadow-xl hover:scale-105'}>
				Take me there!
		  </button>
		  </div>
		</div>
	  </div>
	);
};

export default Home;
